comentario:
Este resultado é declaratório e não é necessário realizar pesquisa T0. É importante ressaltar que o empresário deve descrever, sucintamente, quais foram as práticas econômicas sustentáveis implementadas em sua empresa. O indicador deve ser considerado como uma série de pequenos passos, como por exemplo:
	- Uso eficiente de água, energia, matérias-primas, etc;
	- Redução do volume de resíduos e/ou resíduos perigosos (resíduos que apresentam riscos à saúde pública e ao meio ambiente);
	- Melhoria nas embalagens (redução de plásticos e/ou materiais não sustentáveis, substituição por embalagem ecológica feita de material reciclável);
	- Fomento a investimentos ecológicos - Investimentos que tem por objetivo beneficiar e proteger o meio ambiente;
	- Incentivo a construções ecológicas;
	- Uso de materiais renováveis;
	- Aumento da produtividade no que se refere às práticas sustentáveis e/ou digitais;
	- Otimização de cadeias de valor;
	- Aumento da capacidade da empresa para melhoria de produtos/serviços com o objetivo de atender aos critérios "verdes e sustentáveis" das licitações públicas.
